    @classmethod
    def get_station_info(cls, station_id):
        """Retrieve information for a specific station ID."""
        return cls.stations.get(station_id, "Station ID not found.")

    @classmethod
    def get_stations_by_fuken_id(cls, fuken_id):
        """Retrieve stations with a specified fuken_id."""
        return {
            station_id: data
            for station_id, data in cls.stations.items()
            if data['fuken_id'] == fuken_id
        }

    @classmethod
    def get_stations_by_location_range(cls, lat_min, lat_max, lon_min, lon_max):
        """Retrieve stations within a specified latitude and longitude range."""
        return {
            station_id: data
            for station_id, data in cls.stations.items()
            if lat_min <= data['latitude'] <= lat_max and lon_min <= data['longitude'] <= lon_max
        }

